function formatFallback(value: string): string {
  return value
    .replace(/_/g, " ")
    .replace(/\b([A-Za-z])([A-Za-z]*)\b/g, (_match, first: string, rest: string) =>
      first.toUpperCase() + rest.toLowerCase(),
    );
}

